import React, { Component, Img } from 'react';
import {
  BrowserRouter as Router,
  Route,
  Link,
  Switch,
  Redirect
} from 'react-router-dom';
import { Card, Badge, Row, Col, Button, Menu, Icon } from 'antd';
// partials
import Calender from './partials/Calendar';

// css
import './App.css';
import 'antd/dist/antd.css';

class App extends Component {
  constructor () {
    super(this)
    this.state = {
      current: 'twitter'
    }
  }
  handleClick (e) {
    this.setState({
      current: e.key
    })
  }
  menu () {
    return (
      <Menu
        onClick={this.handleClick}
        selectedKeys={[this.state.current]}
        mode="horizontal">
        <Menu.Item key='twitter'>
          <Icon type='twitter'/> Twitter
        </Menu.Item>
        <Menu.Item key='github'>
          <Icon type='github'/> github
        </Menu.Item>
      </Menu>
    )
  }
  render() {
    return (
      <div className="App">
        {this.menu()}
        <Row>
          <Calender/>
        </Row>
      </div>
    );
  }
}

export default App;
